import React from 'react'
import Navbar from 'react-bootstrap/Navbar'

const Appbar = () => {
  return (
    <Navbar bg="dark">
    <Navbar.Brand href= "#home">CryptoXchange</Navbar.Brand>
    </Navbar>
  )
}

export default Appbar
